import React from 'react';
import {MainPart, MainText, MainImage} from './MainElements';
import {me} from '../../images/me.jpg';

const Main = () => {
  return (
      <>
      <MainPart>
      <MainText>
          <h1>Hi, I'm <span>Madalina</span></h1>
          <p>On my way to become a web developer</p>
      </MainText>
        <MainImage src={me} alt='me' />
      </MainPart>
      </>
  );
};

export default Main;
